import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './component/Home';


function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Routes>
      <h1>productos ecologicos</h1>
      <Route exact path ="/home" component={Home} />
      </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
